package 写真太郎

import (
	"fmt"
	"os"
	"runtime"
)

const base64太郎 = ``

// PrintIfPossible太郎 prints a portrait of vkgtaro if environment can print an image
func PrintIfPossible太郎() {
	switch {
	case os.Getenv("TERM_PROGRAM") == "iTerm.app": // For the iTerm太郎
		fmt.Fprintf(os.Stdout, "\x1b]1337;File=inline=1:%s\a\n", base64太郎)
		return
	case runtime.GOOS == "nacl" && runtime.GOARCH == "amd64p32": // For The Go Playground太郎
		fmt.Fprintf(os.Stdout, "IMAGE: %s", base64太郎)
		return
	default:
		return
	}
}
